import React  from "react";
import {useRouteMatch,Link,Switch,Route} from "react-router-dom";

import "./Login.css"

 export default function Login() {
    return(
        <form>
    <label><p>Username</p>
    <input type="text"/>
    </label>
    <label><p>Password</p>
    <input type="password"/>
    </label>
    <div><button type="submit">Submit</button></div>
    </form>
    )   
    
}
